import React from 'react'


const Card = (props) => {
	return (
		<div className='bg-light-green dib br3 grow pa3 ma2 bw2 shadow-5 tc'>
			<img alt='cardimg' src={'https://robohash.org/${this.props.id}?200x200'} />
			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>	
			</div>
		</div>

		);
}

export default Card;
